import {
    GET_DATA,
    GET_DATA_SUCCESS,
    GET_DATA_ERROR
  } from "./actionTypes"

  export const getData = (req) => ({
    type: GET_DATA,
    payload: { req },
  })
  
  export const getDataSuccess = resp => ({
    type: GET_DATA_SUCCESS,
    payload: resp,
  })
  
  export const getDataFail = error => ({
    type: GET_DATA_ERROR,
    payload: error,
  })
